import React from 'react';

export default class Reg extends React.Component {
  state = {
    nm: '',
    fr: '',
    em: '',
    ps: '',
    ph: '',
  };

  Ren = (eve) => {
    eve.preventDefault();
    this.props.Ren(this.state.em, this.state.ps);
  };
  changeName = (ev) => {
    this.setState({ nm: ev.target.value });
  };
  changeFrstname = (ev) => {
    this.setState({ fr: ev.target.value });
  };
  changeEmail = (ev) => {
    this.setState({ em: ev.target.value });
  };
  changePassword = (ev) => {
    this.setState({ ps: ev.target.value });
  };
  changePhone = (ev) => {
    this.setState({ ph: ev.target.value });
  };

  render() {
    return <div className='reg'></div>;
  }
}
